import React from "react";
import "./ourfeaturesboxes.css"

function OurFeaturesBoxes() {
  return (
    <div>
      <div className="ourFeaturesBoxes">
        <div className="ourFeaturesBox"></div>
        <div className="ourFeaturesBox"></div>
        <div className="ourFeaturesBox"></div>
        <div className="ourFeaturesBox"></div>
      </div>
    </div>
  );
}

export default OurFeaturesBoxes;
